"use strict";var initPageSlider=function(){var i=$(".js-page-slider");i.slick({slidesToShow:1,fade:!0,arrows:!1,dots:!0}),i.mousewheel(function(e){e.preventDefault(),e.deltaY<0?(i.slick("slickNext"),$(".outer-nav").slick("slickNext")):($(".outer-nav").slick("slickPrev"),i.slick("slickPrev"))}),i.swipe({swipe:function(e){"up"==e?i.slick("slickNext"):i.slick("slickPrev")},threshold:50})};$(document).ready(function(){initPageSlider()});